import {
  Route,
  Routes,
} from 'react-router-dom';

import './App.css';

import Landing from "./components/landing";


function App() {
  return (
    <>
    <Routes>
      <Route path="/lol" component={Landing} exact/>
    </Routes>
    <div className="App">
      Hello! this is Raphael...
    </div>
    </>
  );
}

export default App;
